import React from 'react';
import Banner from './../../components/Home/Banner/Banner';
import Menu from './../../components/common/Menu/Menu';
import Footer from './../../components/common/Footer/Footer';
import CartCount from '../../components/common/CartCount/CartCount';
import { menuItemsData } from '../../components/common/Menu/data';
import { useState } from 'react';
import { useEffect } from 'react';
import axios from 'axios'



function Home() {

  const url = 'https://drive.google.com/file/d/1rtaJl6mhaV4cUl2Qwe3WlkkJLFiofRTd/view?usp=sharing'
  const [product, setProduct] = useState(null);

  useEffect(() => {
    axios.get(url).then(response => {setProduct(response.data)})
  }, [url]);

  if(product){
    return <h1>{product.name}</h1>
  }else{
  return <h1> Error </h1>
  }

  
  return <div>
    <Banner/>
    <Menu list={menuItemsData}/>
    <Footer/>
    <CartCount/>
  </div>;
}

export default Home;
